css:
.scrollbars-visible-always .markdown-preview atom-text-editor::shadow .vertical-scrollbar,
.scrollbars-visible-always .markdown-preview atom-text-editor::shadow .horizontal-scrollbar {
  visibility: hidden;
}
.scrollbars-visible-always .markdown-preview atom-text-editor:hover::shadow .vertical-scrollbar,
.scrollbars-visible-always .markdown-preview atom-text-editor:hover::shadow .horizontal-scrollbar {
  visibility: visible;
}
.markdown-spinner {
  margin: auto;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 64px;
  background-position: top center;
  padding-top: 70px;
  text-align: center;
}
